/**
  * @function
  * @name dec
  * @alias decrement
  * @alias subtractOne
  * @param {number} value
  * @returns {number}
  * @example
  * ```
  * dec(3); // 2
  * dec(2); // 1
  * dec(1); // 0
  * dec(0); // -1
  * dec(-1); // -2
  * dec(-2); // -3
  * dec(-3); // -4
  * dec(-4); // -5
  * dec(-5); // -6
  * dec(-6); // -7
  * dec(-7); // -8
  * dec(-8); // -9
  * dec(-9); // -10
  * ```
  */
export default function dec(value: 1): 0;
export default function dec(value: 0): -1;
export default function dec(value: number): number;
